I found some more spousal dialogue!

Here’s what your spouse can say when they’re angry with you, pregnant with or adopting a child, redecorating your house, and other things like cute nicknames they might call you.

It’s not spoilerific, but…

:3c

Portrait Key:

$a = angry

$s = sad/scared

$h = happy

$l = love/blush

“I just feel like sleeping today.$a”

“*sigh*…$s”;

“I’m bored…$s”;

“Sometimes I wonder if I’m doing the right thing with my life…$s”;

“Huh? Nothing’s wrong… I’m fine.$s”;

“I just don’t have any energy today.$s”;

“Life sure is different since we got married…$s”;

“What… you want me to clean? Make you a sandwich? *sigh*…$a”;

“*sigh*… my skin/hair looks horrible today. It does… I can tell by the way you’re looking at me… Don’t you ever feel trapped?$s”;

“*grumble*… chores… $a”;

“Don’t you have work to do?$a”;

“Nghh… what is it? I’m trying to sleep.$a”;

“I just don’t feel like getting up today.$s”;

“*sigh*… I just want to stay in bed.$s”;

“Nnnghh… what is it? Make your own breakfast.$a”;

“… I had a bad dream, that’s all.$s”;

“I wonder how much the new baby will change things?$s”

“I hope our adoption request gets approved. I want a baby.” :

“I filed our adoption papers. Now all we can do is cross our fingers and wait.$l”

“Ugh… I feel a little nauseated this morning.$s” : “I’m pregnant… can’t you make your own breakfast?”

“We’re going to have a baby soon.$l"

"I’m pregnant. Isn’t it wonderful?$l”

“I just feel like sleeping today. Don’t worry about it.$a”

“We’re going to have a baby soon. Can’t you tell? You’re pregnant.$l”

“Being a parent is annoying, sometimes… I just don’t feel like getting up.$a”

“I need some alone time… Why don’t you take care of the kids for a change?$a”

“I was going to make you breakfast, but I changed my mind.$a”,

“I got up early and watered some crops for you. I hope it makes your job a little easier today. I also filled (pet)’s water bowl.”

“Hi ” : “Good Morning! I got up early and watered some crops for you. I hope it makes your job a little easier today. I also filled (pet)’s water bowl.”

“I got up early to water some crops and they were already done! You’ve really got this place under control.$h”

“I got up early and fed all the farm animals. I hope that makes your job a little easier today. I also filled (pet)’s water bowl.”

“I spent the morning repairing a few of the fences. They should be as good as new. I also filled (pet)’s water bowl.”

“What do you think? I ordered this the other day and it just arrived.” : “I figured the room could use a little more decoration.”

“I was going to do some decorating today, but I changed my mind.$a

"What do you think of the new wallpaper I chose?”

“What do you think of the new flooring I chose?”

“*sigh*… sometimes I miss my old life.$s"

"The weather’s too gloomy to get out of bed.$s”

“You could have cleaned up in here a little while I was gone… It’s not very nice to have to wade through a bunch of junk after a hard day’s work.$a”,

